import { useParams, useNavigate } from "react-router-dom";

function Profile() {
  let {} = useParams();

  return (
    <div className="profilePageContainer">
      <div className="basicInfo"></div>
      <div className="listOfPosts"></div>
    </div>
  );
}

export default Profile;
